PRINT '*** CREATE ASSEMBLIES ***'

BEGIN TRY
	CREATE ASSEMBLY Antlr3Runtime  
	AUTHORIZATION [dbo]
	FROM @DLL_Antlr3Runtime
	WITH PERMISSION_SET = SAFE;
	PRINT 'Created assembly Antlr3Runtime';
END TRY
BEGIN CATCH
	PRINT 'Could not create assembly Antlr3Runtime !!!';
	PRINT ERROR_MESSAGE();	
END CATCH
